import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <div>
      <div>
        <button type="button">
          <Link to="/form"> FORMULAIRE MOOD </Link>{' '}
        </button>
      </div>

      <div>
        <button type="button"> 
        <Link to="/deezeflow-playlists"> NOS PLAYLISTS </Link>
        </button>
      </div>
    </div>
  );
};

export default HomePage;
